import { Router } from "react-router-dom"; 
import Footer from "./Components/Footer";
import Navbar from "./Components/Navbar";


function App() {
  return (
  <Router>  
      <div className="App">
      <Navbar/>

        <switch>
        <Route path="./Home"></Route>
        </switch>

        <Footer/>
      </div>
      </Router>
  );
}

export default App;
